--
-- Table structure for table `posts`
--

DROP TABLE IF EXISTS `posts`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `posts` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `user_id` int unsigned NOT NULL COMMENT 'Идентификатор пользователя',
  `communiti_id` int unsigned DEFAULT NULL COMMENT 'Идентификатор группы',
  `head` varchar(255) DEFAULT NULL COMMENT 'Заголовок поста',
  `body` text NOT NULL COMMENT 'Текст поста',
  `media_id` int unsigned DEFAULT NULL COMMENT 'Идентификатор медиафайла',
  `is_public` tinyint(1) DEFAULT '1' COMMENT 'Публичный ли пост',
  `is_archived` tinyint(1) DEFAULT '0' COMMENT 'Заархивированный ли пост',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Дата создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Дата обновления строки',
  PRIMARY KEY (`id`),
  KEY `posts_user_id_fk` (`user_id`),
  KEY `posts_community_id_fk` (`communiti_id`),
  KEY `posts_media_id_fk` (`media_id`),
  CONSTRAINT `posts_community_id_fk` FOREIGN KEY (`communiti_id`) REFERENCES `communities` (`id`) ON DELETE SET NULL,
  CONSTRAINT `posts_media_id_fk` FOREIGN KEY (`media_id`) REFERENCES `media` (`id`) ON DELETE SET NULL,
  CONSTRAINT `posts_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE RESTRICT
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

